import React, { Component } from 'react';

class Member extends Component {
    state = {
        information: [
            {
                id: 0,
                number: 'DSM2016',
                name: '이재석'
            }
        ]
    }
    render() {
        const { information } = this.state;
        const list = information.map(
            info => (<Member key={info.id} info={info}/>)
        );
        return (
            <p>{list}</p>
        );
    }
}

export default Member;
